import React, { Component } from "react";
import "./App.css";

class App extends Component {
  state = {
    deadline: ""
  };
  render() {
    return (
      <div className="App">
        <div>
          <h2>Count down to {this.state.deadline}</h2>
          <input placeholder="enter new date" />
          <button>Submit</button>
        </div>
      </div>
    );
  }
}

export default App;
